import React from 'react'

export const Footer = () => {
    let footerStyle = {
        position: "relative",
        width: "100%",
        top: "100vh"

    }
    return (
        <footer className='bg-dark text-light text-center' style={footerStyle}>
            <p>
                Copyright &copy; MyTodoList.com
            </p>
        </footer >
    )
}
